import React from 'react';
import './styles.css';

function Home() {
  return (
    <div>
      <h1>Bem-vindo ao Privacy Policy Analyzer</h1>
      <p>Use esta aplicação para gerenciar políticas de privacidade.</p>
    </div>
  );
}

export default Home;
